import React from 'react';
import Post from '../Post/Post';
import avatarka from '../image/down2.jpg';
import m from './MyPosts.module.css';

const MyPosts = (props) => {
  let Ofmsg = props.mymsg.map((pst) => {
    return <Post img={pst.img} ike={pst.ike} msg={pst.msg} />;
  });
  return (
    <div className={m.mypost}>
      <div>My posts</div>
      <form>
        <textarea rows='12px' cols='13px'></textarea>
        <button
          onClick={() => {
            alert('inchka');
          }}
        >
          add text
        </button>
      </form>
      <div>New Post</div>
      <div className='posts'>{Ofmsg}</div>
    </div>
  );
};

export default MyPosts;
